        <div>
        <input type="text" name="search" onChange={handleChangeSearch} />
        <button onClick={onClickLoading}>Загрузить</button>
        <button onClick={onClickClear}>Очистить</button>
        <button onClick={onClickGroup}>Группировать</button>

      </div>
    );
  }
